import React from "react";

class Tile extends React.Component {
  constructor(props) {
    super(props);
    console.log("tile", props);
    this.state = {
      data: props.data,
      active: props.active
    };
    // if (props.active === true) {
    //   return "blinkDivUp";
    // } else {
    //   return "";
    // }
  }

  render() {
    return (
      <div
        className="tile blinkDivUp"
        style={{
          backgroundColor: this.state.data.bkgd
        }}
      >
        <div className="title">{this.state.data.title}</div>
        <div className="number">{this.state.data.number}</div>
      </div>
    );
  }
}

export default Tile;
